import React, { useEffect, useState } from 'react'
import  useFetchApi from './useFetchApi'
import Marquee from 'react-marquee-master'
import '../styles/Lists.scss'

export default function Example() {

    const url = 'https://criminalimpulse.com/api/getTopPlayer';
    const { data } = useFetchApi(url);

    const itemExists = (data.length) ? <Marquee marqueeItems={data} minHeight="300px" /> : [0, 1];

    return [
        <div height='300px' className='player-left'>
            <p className='listHeading'>Menu Heading</p>
            {itemExists}
        </div>,
        <div height='300px' className='player-right'>
            <p className='listHeading'>Menu Heading</p>
            <div className="marquee" list={data} direction='vertical' lines="5">
                {itemExists}
            </div>
        </div>
    ];
}
